webpackJsonp([0xf633f1552ad4],{7562:function(e,t){e.exports={data:{post:{html:"<p>I was able to talk with my brother this evening. The pain is down to where he can sleep, albeit restlessly. The new CT scan revealed a large mass in his abdomen, and he's waiting rather impatiently for a biopsy to be performed. Only then will they know what the next step will be, either chemotherapy or surgery.</p>\n<p>I told him about the <a href=\"http://www.papascott.de/archives/2006/03/05/life-sucks/\">T-shirt</a>, and he wants one. It's on its way.  </p>",fields:{title:"Got Morphine?",date:"07 Mar 2006",url:"https://papascott.de/2006-03-07-got-morphine/"}}},pathContext:{slug:"/2006-03-07-got-morphine/",prev:{fields:{title:"Life Sucks",date:"05 Mar 2006",slug:"/2006-03-05-life-sucks/"}},next:{fields:{title:"Puckett dies after massive stroke",date:"07 Mar 2006",slug:"/2006-03-07-puckett-dies-after-massive-stroke/"}}}}}});
